import { SaveOutlined } from "@mui/icons-material";
import { Box, Button, TextField, Typography } from "@mui/material";
import React from "react";

type ButtonProps = {
    update: (value : number) => void;
  };

  interface FormDataInterface {
    firstName : string,
    lastName : string,
    email : string
  }

  const save = (formData) =>{
    alert(formData)
  }
  

const CreateContact = ({update} : ButtonProps) => {
  return (
    <Box
      sx={{
        width: "100%",
        height: "90vh",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        alignContent: "center",
        border: 1,
        borderColor: "lightgrey",
        overflowX: "hidden",
      }}
    >
      <Box
        sx={{
          width: "70%",
          height: "80vh",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          alignContent: "center",
          border: 1,
          borderColor: "lightgrey",
        }}
      >
        <Box component={"form"} sx={{ width: "80%" }} onSubmit={(formData) => save(formData)}>
          <Box
            sx={{
              display: "flex",
              direction: "row",
            }}
          >
            <TextField
              name="firstName"
              label={"FirstName"}
              variant={"outlined"}
              sx={{ width: "100%", mr: 2 }}
              type={"text"}
            />
            <TextField
              name="lastName"
              label={"LastName"}
              variant={"outlined"}
              sx={{ width: "100%" }}
              type={"text"}
            />
          </Box>

          <TextField
            name="email"
            label={"Email"}
            variant={"outlined"}
            sx={{ width: "100%", mt: 2 }}
            type={"email"}
          />

          <Button 
            type="submit"
            variant="outlined"
            endIcon={<SaveOutlined />}
            sx={{ width: "100%", mt: 2 }}
          >
            <Typography align="center">Save</Typography>
          </Button>
        </Box>
      </Box>
    </Box>
  );
};

export default CreateContact;
